import React from "react";

function NotFound() {
  return (
    <div className="not-found-root">
      404 <br />
      요청하신 페이지를 찾을 수 없습니다. <br />
      페이지가 삭제되었거나 주소가 변경되었을 수 있습니다.
    </div>
  );
}

export default NotFound;
